import styles from './Projects.module.css'
import ButtonB from './elements/ButtonB.js'

function Projects(){
    return(
        <div id='Projects'>
            <h1>Projetos </h1>
            <p>Cards</p>
            <ButtonB text='Acesse meu repositório' link='https://github.com/boarini?tab=repositories'/>
        </div>
    )
}

export default Projects
